const Contact = () => {
  return (
    <div className='contact-info'>
      <h1>Contact</h1>

      <p>
        "I'm Brian, the founder of a landscaping business that blends my 25-year
        background as a User Interface Software Engineer with my love for
        crafting visually stunning outdoor spaces. Following my Microsoft
        contract, I've embraced this new path to explore possibilities,
        intertwining software expertise into my landscaping vision. This venture
        represents seizing the present to create a future. While the ultimate
        direction is yet to unfold, I'm excited to fully engage in the journey."
      </p>
      <p>
        <strong>Email:</strong>{' '}
        <a href='mailto:info.curbAppeal@gmail.com'>info.curbAppeal@gmail.com</a>
      </p>
      <p>
        <strong>Call:</strong> <a href='tel:+4257732818'>(425) 773-2818</a>
      </p>
    </div>
  );
};

export default Contact;
